def sort_and_check_stability(cards, n):

    def partition(A, p, r):
        x = A[r][1]
        i = p + 1
        for j in range(p, r):
            if A[j][1] <= x:
                i += 1
                (A[i], A[j]) = (A[j], A[i])
        (A[i + 1], A[r]) = (A[r], A[i + 1])
        return i + 1

    def quick_sort(A, p, r):
        if p < r:
            q = partition(A, p, r)
            quick_sort(A, p, q - 1)
            quick_sort(A, q + 1, r)
    ind = dict(((e, i) for (i, e) in enumerate(cards)))
    quick_sort(cards, 0, n - 1)
    for i in range(n - 1):
        if cards[i][1] == cards[i + 1][1]:
            if ind[cards[i]] > ind[cards[i + 1]]:
                return ('Not stable', cards)
    return ('Stable', cards)

